% Ashwin Foucault Q5 %
%--------------------%
% N.B. Signal Processing Toolbox is required!

clear

format long

tic
L = 67;
Omega = 2*pi/86164; 
sigma = pi/180*(48.1); 
m = 28; 
R_E = 6371000;
% gamma = 0; 
g = 9.81;

K = Omega*cos(sigma);


% Defines RHS of coupled ODEs
function state = fsolver(t,u)

L = 67;
Omega = 2*pi/86164; 
sigma = pi/180*(48.1); 
m = 28; 
R_E = 6371000;
g = 9.81;
R = 8.5*1e-2; 
mu = 1.81*1e-5; 

gamma = 0.00000; 
%gamma = 6*pi*mu*R;

K = Omega*cos(sigma);

state = zeros(4,1); 

state(1:2) = u(3:4); 
z = -sqrt(L^2-(u(1))^2-(u(2))^2); 
zdot = -(u(1)*u(3) + u(2)*u(4))/(z);

Eqx = 2*K*u(4) + ((Omega)^2)*R_E*cos(sigma)*sin(sigma) - gamma/m*u(3); 
Eqy = -2*Omega*sin(sigma)*zdot - 2*K*u(3) - gamma/m*u(4); 
Eqz = 2*Omega*sin(sigma)*u(4) - g - gamma/m*zdot; 

xddot = 1/(L^2 + (u(1))^2 + (u(2))^2)*(Eqx*(L^2 + (u(2))^2 - (u(1))^2) - 2*Eqy*u(1)*u(2) - Eqz*u(1)*z + (u(1)/z^2)*((u(3)*u(2) - u(4)*u(1))^2 - L^2*((u(3))^2 + (u(4))^2))); 
yddot = 1/(L^2 + (u(1))^2 + (u(2))^2)*(Eqy*(L^2 - (u(2))^2 + (u(1))^2) - 2*Eqx*u(1)*u(2) - Eqz*u(2)*z + (u(2)/z^2)*((u(3)*u(2) - u(4)*u(1))^2 - L^2*((u(3))^2 + (u(4))^2))); 

state(3:4) = [xddot; yddot]; 

end

% Defines initial conditions [x0; y0; vx0; vy0]
state_init = [3;0;0;0]; 

% Defines timespan(s)
N = 200000 %[output:60093daf]
tspan = linspace(0,2*86164,N);
tspan_other = linspace(0,2*pi/K,N);

% Solves ODEs 
opts = odeset('RelTol',1e-10,'AbsTol',1e-10);
[t, state] = ode45(@fsolver, tspan, state_init, opts);

% Defines x, y, z positions and horizontal radial distance 
xs = state(:,1);
ys = state(:,2);
zs = -sqrt(L^2-(xs).^2-(ys).^2);
rs = sqrt(xs.^2+ys.^2);

% Defines x, y, z velocities and squared magnitude of velocity
xdots = state(:,3);
ydots = state(:,4);
zdots = (xs.*xdots + ys.*ydots)./(-zs);
vels_sq = xdots.^2 + ydots.^2 + zdots.^2;

% Defines kinetic, gravitational potential and total energies 
kins = 1/2*m*vels_sq;
pots = m*g*(zs+L);
energies = kins + pots;

% Creates upper and lower envelopes for the (generally) rapidly oscillating
% xs and ys 
[E_xs_upper,E_xs_lower] = envelope(xs,10,'peak');
[E_ys_upper,E_ys_lower] = envelope(ys,10,'peak'); 

%[E_rs_upper,E_rs_lower] = envelope(rs,100,'peak');
%logE_rs = log(E_rs_upper);
% [E_E_rs_upper,E_E_rs_lower] = envelope(E_rs_upper,10000,'peak');


E_xs = zeros(2,N);
E_ys = zeros(2,N);
E_xs(1,:) = E_xs_upper;
E_xs(2,:) = E_xs_lower;
E_ys(1,:) = E_ys_upper;
E_ys(2,:) = E_ys_lower;

% Sets minimum peak prominence 
minPP = norm(state_init)/20;

% Finds "zeros" of x and y envelopes by finding peaks of lower envelopes
[xpeaks,xlocs] = findpeaks(E_xs_lower,MinPeakProminence = minPP) %[output:47e69d4d] %[output:9cf6107e]
[ypeaks,ylocs] = findpeaks(E_ys_lower,MinPeakProminence = minPP) %[output:259a29fc] %[output:75478539]

% Initialises vectors for the locus of one extremum of oscillation in x and
% y directions 
x_outline = zeros(1,N); 
y_outline = zeros(1,N); 

% Defines these vectors in terms of parts of either the upper or lower 
% envelopes, depending on which index has been reached between peaks 
% N.B. This assumes that the initial displacement is positive (and small)! 
if isempty(xpeaks)
    x_outline = E_xs_upper';
elseif length(xpeaks) == 1
    x_outline(1:xlocs(1)) = E_xs_upper(1:xlocs(1));
    x_outline(xlocs(1)+1:N) = E_xs_lower(xlocs(1)+1:N);
else
    x_outline(1:xlocs(1)) = E_xs_upper(1:xlocs(1));
    for k = 1:length(xpeaks)-1
        x_outline(xlocs(k)+1:xlocs(k+1)) = E_xs((3/2+1/2*(-1)^(k+1)), xlocs(k)+1:xlocs(k+1));
    end
    x_outline(xlocs(length(xpeaks))+1:N) = E_xs((3/2+1/2*(-1)^(length(xpeaks)+1)), xlocs(length(xpeaks))+1:N);
end

% Changes which part of the y-envelope is used depending on the hemisphere 
if cos(sigma) >= 0
    if isempty(ypeaks)
        y_outline = E_ys_lower';
    elseif length(ypeaks) == 1
        y_outline(1:ylocs(1)) = E_ys_lower(1:ylocs(1));
        y_outline(ylocs(1)+1:N) = -E_ys_lower(ylocs(1)+1:N);
    else
        y_outline(1:ylocs(1)) = E_ys_lower(1:ylocs(1));
        for k = 1:length(ypeaks)-1
            y_outline(ylocs(k)+1:ylocs(k+1)) = E_ys((3/2+1/2*(-1)^(k)), ylocs(k)+1:ylocs(k+1));
        end
        y_outline(ylocs(length(ypeaks))+1:N) = E_ys((3/2+1/2*(-1)^(length(ypeaks))), ylocs(length(ypeaks))+1:N);
    end
else
    if isempty(ypeaks)
        y_outline = E_ys_upper';
    elseif length(ypeaks) == 1
        y_outline(1:ylocs(1)) = E_ys_upper(1:ylocs(1));
        y_outline(ylocs(1)+1:N) = -E_ys_upper(ylocs(1)+1:N);
    else
        y_outline(1:ylocs(1)) = E_ys_upper(1:ylocs(1));
        for k = 1:length(ypeaks)-1
            y_outline(ylocs(k)+1:ylocs(k+1)) = E_ys((3/2+1/2*(-1)^(k+1)), ylocs(k)+1:ylocs(k+1));
        end
        y_outline(ylocs(length(ypeaks))+1:N) = E_ys((3/2+1/2*(-1)^(length(ypeaks)+1)), ylocs(length(ypeaks))+1:N);
    end
end

% Defines angle turned through by extremum and theoretical angle (for small
% displacements) obtained analytically 
if cos(sigma) >= 0
    angle = (mod(atan2(-y_outline, x_outline),2*pi) - mod(atan2(-ys(1), xs(1)),2*pi));
else
    angle = (mod(atan2(y_outline, x_outline),2*pi) - mod(atan2(ys(1), xs(1)),2*pi));
end
angle_theos = K*tspan;
angle_diff = -(angle - angle_theos);
%x_outline
%y_outline

k = sqrt(K^2 + g/L);
x_preds = state_init(1).*(cos(K.*tspan));
y_preds = state_init(1).*(-sin(K.*tspan));

clf %[output:5500413d]

plot(tspan, xs,"b") %[output:5500413d]
ylim([min(xs),max(xs)]) %[output:5500413d]
plot(tspan, ys,"r") %[output:2338b25e]
ylim([min(ys),max(ys)]) %[output:2338b25e]
plot(tspan, zs,"g") %[output:50fc20ef]
plot(tspan, rs,"m") %[output:0a20d6a3]


plot(tspan, E_xs_upper, "b", tspan, E_xs_lower, "b") %[output:8f6b0faf]
plot(tspan, E_ys_upper, "r", tspan, E_ys_lower, "r") %[output:770a91d1]

%plot(tspan, E_E_rs_upper, "m")
% plot(tspan, E_rs_upper, "k")
% plot(tspan, logE_rs, "m")
%plot(tspan, log(E_E_rs_upper),"k")


%plot(tspan,kins,tspan,pots)
plot(tspan,energies) %[output:8d64f27b]
ylim([0,1.1*max(energies)]) %[output:8d64f27b]

plot(tspan/3600, x_outline,"b", DisplayName = "$X(t)$", LineWidth = 1.2) %[output:3a5373b2]
hold on  %[output:3a5373b2]
plot(tspan/3600, y_outline,"r", DisplayName = "$Y(t)$", LineWidth = 1.2) %[output:3a5373b2]
if state_init(2) == 0
    plot(tspan/3600, x_preds,"b--", DisplayName = "$X_{pred}(t)}$", LineWidth = 1.0) %[output:3a5373b2]
    plot(tspan/3600, y_preds,"r--", DisplayName = "$Y_{pred}(t)$", LineWidth = 1.0) %[output:3a5373b2]
end
xlim([tspan(1)/3600,tspan(end)/3600]) %[output:3a5373b2]
ylim([-norm(state_init),norm(state_init)]) %[output:3a5373b2]
ax1 = gca;
%ax1.TickLabelInterpreter = 'latex';
ax1.XAxis.FontSize = 18; %[output:3a5373b2]
ax1.YAxis.FontSize = 18; %[output:3a5373b2]
xlabel("Time, \itt \rm(hours)", FontSize = 18) %[output:3a5373b2]
ylabel("Displacement (m)", FontSize = 18) %[output:3a5373b2]
lgd1 = legend("\itX(t)", "\itY(t)", Position = [0.3084 0.7302 0.1391, 0.1651], FontSize = 18); %[output:3a5373b2]
lgd1.IconColumnWidth = 20; %[output:3a5373b2]
%lgd2 = legend("$X_{pred}(t)$", "$Y_{pred}(t)$", location = "southeast", Interpreter = 'latex')
hold off %[output:3a5373b2]
grid on %[output:3a5373b2]
pbaspect([1.4,1,1]) %[output:3a5373b2]
ax1.FontName = "Times"; %[output:3a5373b2]

% Creates a buffer plot (as the double y-axis leaks into previous plot)
plot([1,1]) %[output:4b8949cc]
cutoff = 153810;

% Plots predicted vs. actual angle turned through by extremum 
yyaxis left %[output:4b8949cc]
p21 = plot(tspan(2:cutoff)/3600, 180/pi*angle_theos(2:cutoff), "-.", DisplayName = "Predicted", LineWidth = 1.2); %[output:4b8949cc] %[output:9c1b9403]
p21.Color = [0.5 0 0.6500]; %[output:9c1b9403]
hold on %[output:9c1b9403]
p22 = plot(tspan(2:cutoff)/3600, 180/pi*angle(2:cutoff), "b-", DisplayName = "Actual", LineWidth = 1.2); %[output:9c1b9403]
p22.Color = [0.5 0 0.8500]; %[output:9c1b9403]
ax2 = gca;
%ax2.TickLabelInterpreter = 'latex';
ax2.XAxis.FontSize = 18; %[output:9c1b9403]
ax2.YAxis(1).FontSize = 18; %[output:9c1b9403]
ax2.YAxis(1).Color = [0.5 0 0.8500]; %[output:9c1b9403]
xlabel("Time, \itt \rm(hours)", FontSize = 18) %[output:9c1b9403]
ylabel("      Precession angle (degrees)", FontSize = 18) %[output:9c1b9403]
xlim([tspan(1)/3600,tspan(cutoff)/3600]) %[output:9c1b9403]
ylim([0,400]) %[output:9c1b9403]
ax2.FontName = "Times"; %[output:9c1b9403]
ax2.YLabel(1).Position = ax2.YLabel(1).Position - 2.6; %[output:9c1b9403]


yyaxis right %[output:9c1b9403]
ax2.YAxis(2).Color = [1 0.4 0]; %[output:9c1b9403]
p = plot(tspan(2:cutoff)/3600, 180/pi*angle_diff(2:cutoff), DisplayName = "Difference", HandleVisibility = 'off', LineWidth = 1.1); %[output:9c1b9403]
p.Color = [1 0.5 0]; %[output:9c1b9403]
ax2.YAxis(2).FontSize = 18; %[output:9c1b9403]
ylabel("Difference in angle (degrees)", FontSize = 18) %[output:9c1b9403]
ylim([0,30]) %[output:9c1b9403]
pbaspect([1.2,1,1]) %[output:9c1b9403]

fontname("Times"); %[output:9c1b9403]
lbl = {'Predicted','period'};
greycolor = [0.4 0.4 0.4];
xl = xline(2*pi/K/3600, ":", lbl, LineWidth = 1.6, LabelVerticalAlignment = "middle", LabelHorizontalAlignment = 'left', FontSize = 16, FontName = "Times"); %[output:9c1b9403]
xl.Color = greycolor;  %[output:9c1b9403]

lgd3 = legend('Predicted', 'Actual', location = 'northwest', FontSize = 18); %[output:9c1b9403]
lgd3.IconColumnWidth = 19; %[output:9c1b9403]

%(tspan(xlocs(3))-tspan(xlocs(1)))/3600  
(Omega)^2*R_E*cos(sigma)*sin(sigma) %[output:21df5912]

E_xs_upper;
E_xs_lower;

toc %[output:63512248]

